import * as ReactDOMClient from "react-dom/client";
import React from "react";
import "./index.css";
import App from "./App";

ReactDOMClient.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);


const root = ReactDOMClient.createRoot(document.get);
// 최초 렌더링 시
root.render(<App />);
// 업데이트가 발생했을 때, container를 다시 넘겨줄 필요가 없다.
root.render(<App />);

